import VideoCardInfo from "./video-card-info/VideoCardInfo";
import "./VideoCard.scss";

export default function VideoCard(props) {
  console.log(props);
  return (
    <div>
      <img
        className="video-card__thumbnail"
        src="https://youtube.com"
        alt="current video thumbnail"
      ></img>
      <div>
        <h3>Video Title</h3>
        <h4>Video Channel</h4>
      </div>
    </div>
  );
}
